import React from "react";
import logo from "./logo.svg";

const Main = () => {
  return (
    <div className="container">
      <h1>Weather App</h1>
      <div className="weather-block">
        <h2>Minsk</h2>
        <div className="weather-icon">{logo}</div>
      </div>
    </div>
  );
};

export default Main;
